import React from 'react';

// == Style 
import ProductStyled from './ProductStyled';

const Product = () => {
  return (
    <ProductStyled>
      <div className="fildAriane">
        <img src="" alt="bouton retour arrière"/>
        <p>Retour | Catalogue | Féculent | Lentilles corail</p>
      </div>
    </ProductStyled>
  );
};

export default Product;
